import { LeadershipValue, UserInfo } from "@/types";
import { jsPDF } from "jspdf";
import autoTable from "jspdf-autotable";

const logo =
  "";

// Base64 encoded dummy signature
const signature =
"";

/**
 * Generates a PDF with the user's core leadership values and returns it as base64 string
 */
export const generatePDF = (
  coreValues: LeadershipValue[],
  userInfo: UserInfo
): string => {
  const { name, email } = userInfo;
  const currentDate = new Date().toLocaleDateString("en-US", {
    year: "numeric",
    month: "long",
    day: "numeric",
  });

  // Create a new document
  const doc = new jsPDF();

  // ===== PAGE 1: Core Values Report =====

  // Add logo at the top
  doc.addImage(logo, "PNG", 10, 0, 30, 30);

  // Add title
  doc.setFontSize(20);
  doc.setTextColor(15, 23, 42); // Dark blue color
  doc.text("Leadership Core Values", 105, 35, { align: "center" });

  // Add user info
  doc.setFontSize(12);
  doc.setTextColor(75, 85, 99); // Gray color
  doc.text(`Name: ${name}`, 20, 50);
  doc.text(`Email: ${email}`, 20, 60);
  doc.text(`Date: ${currentDate}`, 20, 70);

  // Add description
  doc.setFontSize(12);
  doc.setTextColor(55, 65, 81);
  const description =
    "Your core leadership values reflect your authentic self and guide your decision-making. " +
    "These values represent who you are at your best and should inform how you lead others.";

  const splitDescription = doc.splitTextToSize(description, 170);
  doc.text(splitDescription, 20, 85);

  // Add values table
  const tableData = coreValues.map((value, index) => [
    `${index + 1}`,
    value.value,
    value.description,
  ]);

  autoTable(doc, {
    startY: 100,
    head: [["#", "Core Value", "Description"]],
    body: tableData,
    headStyles: {
      fillColor: [15, 23, 42],
      textColor: [255, 255, 255],
      fontStyle: "bold",
    },
    alternateRowStyles: {
      fillColor: [240, 245, 255],
    },
    theme: "grid",
  });

  // Calculate the end position of the table
  const finalY = (doc as any).lastAutoTable.finalY + 20;

  // Add Reflections section
  doc.setFontSize(16);
  doc.setTextColor(15, 23, 42);
  doc.text("Reflections for your values", 20, finalY);

  doc.setFontSize(12);
  doc.setTextColor(55, 65, 81);

  let currentY = finalY + 10;

  coreValues.forEach((value, index) => {
    // Check if we need a new page
    if (currentY > 250) {
      doc.addPage();
      currentY = 20;
    }

    doc.setFontSize(14);
    doc.setTextColor(15, 23, 42);
    doc.text(`${index + 1}. ${value.value}`, 20, currentY);
    currentY += 10;

    doc.setFontSize(12);
    doc.setTextColor(55, 65, 81);
    doc.text(
      `How does ${value.value} show up in your leadership style?`,
      30,
      currentY
    );
    currentY += 10;

    // Add lines for writing
    for (let i = 0; i < 3; i++) {
      doc.setDrawColor(200, 200, 200);
      doc.line(30, currentY, 180, currentY);
      currentY += 8;
    }

    currentY += 10; // Space between values
  });

  // ===== PAGE 2: Certificate =====

  // Add certificate page
  doc.addPage();

  // Add border
  doc.setDrawColor(15, 23, 42);
  doc.setLineWidth(2);
  doc.roundedRect(15, 15, 180, 267, 5, 5); // Outer border
  doc.setDrawColor(70, 130, 180);
  doc.setLineWidth(1);
  doc.roundedRect(20, 20, 170, 257, 3, 3); // Inner border

  // Add logo at the top of certificate
  doc.addImage(logo, "PNG", 85, 25, 30, 30);

  // Add certificate title
  doc.setFontSize(24);
  doc.setTextColor(15, 23, 42);
  doc.text("My Top 5 Values I Live By", 105, 70, { align: "center" });

  // Add name
  doc.setFontSize(20);
  doc.setTextColor(70, 130, 180);
  doc.text(name, 105, 95, { align: "center" });

  // Add certificate text
  doc.setFontSize(12);
  doc.setTextColor(55, 65, 81);
  const certificateText =
    "This certificate acknowledges your commitment to living and leading by your core values. " +
    "Your authentic leadership journey is guided by the following values:";

  const splitCertText = doc.splitTextToSize(certificateText, 150);
  doc.text(splitCertText, 105, 110, { align: "center" });

  // Add values in a stylized way
  doc.setFontSize(16);
  doc.setTextColor(15, 23, 42);

  // Create a centered, stylish list of values
  let valueY = 140;
  coreValues.forEach((value, index) => {
    doc.setDrawColor(70, 130, 180);
    doc.setFillColor(240, 248, 255);
    doc.roundedRect(55, valueY - 5, 100, 10, 2, 2, "F");
    doc.text(value.value, 105, valueY, { align: "center" });
    valueY += 15;
  });

  // Add date
  doc.setFontSize(12);
  doc.setTextColor(55, 65, 81);
  doc.text(`Completed on ${currentDate}`, 105, 220, { align: "center" });

  // Add signature
  doc.addImage(signature, "PNG", 105 - 40, 231, 80, 23);
  doc.setDrawColor(100, 100, 100);
  doc.line(65, 255, 145, 255);
  doc.setFontSize(10);
  doc.text("Leadership Coach", 105, 265, { align: "center" });

  // Add footer
  const pageCount = doc.getNumberOfPages();
  for (let i = 1; i <= pageCount; i++) {
    doc.setPage(i);
    doc.setFontSize(10);
    doc.setTextColor(150, 150, 150);
    doc.text(
      `Page ${i} of ${pageCount}`,
      doc.internal.pageSize.width - 20,
      doc.internal.pageSize.height - 10,
      { align: "right" }
    );
  }

  // Return PDF as base64 string for email attachment
  return doc.output("datauristring");
};
